  expected_count: 5
  input: TEXT,F3A,,"Hurricane Katrina resulted in the loss of the campaign office,
    both home offices and all computer equipment. Data files were restored and the
    Oct 15, 2005 report was filed on 12/29/05. Bank files were restored in March of
    2006 and provided data for  the year end report filed on 4/12/06. A series of
    power and phone line failures caused three computer crashes wiih resulting corruption
    of the DCF files. With the help of FEC tech support the files were reformatted
    into the correct form for filing. Amendments in response to FEC letter (3) of
    June 5, 2006 and the letter of June 21 have been files as of June 26, 2007.  We
    are rebuilding the campaign equipment and revising data management software to
    correct the cause of the several FEC letter. Communications are still not 100%.
    The campaign office staff anticipate full service by mid September. Thank God
    the  election was not in November of 2005."
